import React, { useState } from 'react';
import Hazardform from './pages/Hazardform';
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom'
import Accidentform from './pages/Accidentform'
import Trafficform from './pages/Trafficform'
function Report(){
  return(
    <div className='report'>
      <Router>
        <Routes>
          <Route path='/' exact element={<Accidentform />}/>
          <Route path='/report' exact element={<Hazardform />}/>
          <Route path='/view' exact element={<Trafficform />}/>
        </Routes>
      </Router>
    </div>
  )
}
export default Report
